export default function Accordion(props) {
  const { items } = props
  const renderedItems = items.map((item, index) => {
  return (
    <div key={item.id}>
        <div className="flex justify-between p-3 bg=gray-100">{item.label}</div>
        <div>{item.content}</div>
    </div>
  )
})

  return (
    <div>{renderedItems}</div>
  )
}
